SELECT "Generico_5"."Vehiculo" AS "Vehiculo",   CAST(EXTRACT(MONTH FROM "Generico_5"."FECHA") AS SIGNED) AS "mn:FECHA:ok",   CAST(EXTRACT(YEAR FROM "Generico_5"."FECHA") AS SIGNED) AS "yr:FECHA:ok" FROM "Generico_5" WHERE ((CAST(EXTRACT(YEAR FROM "Generico_5"."FECHA") AS SIGNED) >= 2010) AND (CAST(EXTRACT(YEAR FROM "Generico_5"."FECHA") AS SIGNED) <= 2015) AND ("Generico_5"."Anunciante" IN ('BANTRAB/TODOTICKET', 'TODOTICKET', 'TODOTICKET.COM')) AND ("Generico_5"."Medio" = 'TELEVISION NACIONAL')) GROUP BY "Generico_5"."Vehiculo", "mn:FECHA:ok", "yr:FECHA:ok";
